import './App.css';
import React from 'react';
import { Routes, Route} from 'react-router-dom';
import IniciarApp from './componentes/IniciarApp';
import Header from './componentes/Header';
import Login from './componentes/LoginyRegistro/Login';
import Registro from './componentes/LoginyRegistro/Registro';




function App() {
  return (
    <div className="App bg-secondary " style={{height: "100vh"}}>
      <Header/>
    <Routes>
      <Route path="/" element={<IniciarApp/>}></Route>
      <Route path="/login" element={<Login/>}></Route>
      <Route path="/registro" element={<Registro/>}></Route>


    </Routes>
    </div>
  );
}

export default App;
